cy.get('[data-cy="new-password-input"]').type("654321");
// ยืนยันรหัสผ่านใหม่ไม่ตรงกัน
cy.get('[data-cy="confirm-password-input"]').type("111111");
// คลิกปุ่มยืนยันเปลี่ยนรหัสผ่าน
cy.get('[data-cy="submit-password-change"]').click();
// ตรวจสอบว่ามีการแจ้งเตือนข้อผิดพลาด
cy.on("window:alert", text => {
  expect(text).to.equal("รหัสผ่านใหม่ไม่ตรงกัน");
});
// ตรวจสอบว่าโมดัลยังคงเปิดอยู่
cy.get('[data-cy="change-password-modal"]').should("be.visible");

// คลิกปุ่มลบผู้ใช้
cy.get('[data-cy="delete-user-button"]').click();
// ตรวจสอบว่าโมดัลยืนยันการลบแสดงขึ้นมา
cy.get('[data-cy="delete-user-modal"]').should("be.visible");

// คลิกปุ่มลบผู้ใช้
cy.get('[data-cy="delete-user-button"]').click();
// ตรวจสอบว่าโมดัลยืนยันการลบแสดงขึ้นมา
cy.get('[data-cy="delete-user-modal"]').should("be.visible");
// คลิกปุ่มยกเลิก
cy.get('[data-cy="cancel-delete"]').click();
// ตรวจสอบว่าโมดัลปิดลง
cy.get('[data-cy="delete-user-modal"]').should("not.exist");

// Mock API สำหรับการลบผู้ใช้
cy.intercept("DELETE", `**/api/users/${targetUser.id}`, {
  statusCode: 200,
  body: {
    success: true
  }
}).as("deleteUser");
// คลิกปุ่มลบผู้ใช้
cy.get('[data-cy="delete-user-button"]').click();
// ตรวจสอบว่าโมดัลยืนยันการลบแสดงขึ้นมา
cy.get('[data-cy="delete-user-modal"]').should("be.visible");
// คลิกปุ่มยืนยันการลบ
cy.get('[data-cy="confirm-delete"]').click();
// รอการเรียก API
cy.wait("@deleteUser");
// ตรวจสอบว่าได้กลับไปยังหน้ารายชื่อผู้ใช้
cy.url().should("include", "/users");
cy.url().should("not.include", `/users/${targetUser.id}`);

// Mock API สำหรับการเปลี่ยนรหัสผ่าน
cy.intercept("PUT", `**/api/users/${targetUser.id}/password`, {
  statusCode: 200,
  body: {
    success: true
  }
}).as("adminChangePassword");
// คลิกปุ่มเปลี่ยนรหัสผ่าน
cy.get('[data-cy="change-password-button"]').click();
