cy.get('[data-cy="submit-password-change"]').click();
// รอการเรียก API
cy.wait("@adminChangePassword");
// ตรวจสอบว่าโมดัลปิดลง
cy.get('[data-cy="change-password-modal"]').should("not.exist");

