cy.window().then(window => {
  window.localStorage.setItem("user", JSON.stringify({
    user_id: 888,
    // ID ต่างจาก targetUser.id
    name: "Normal User",
    email: "normal@example.com",
    role: "User",
    // ไม่ใช่ Admin
    token: "fake-token-for-testing"
  }));
});
