cy.intercept("GET", `**/api/users/${targetUser.id}`, {
  statusCode: 401,
  body: {
    message: "เซสชั่นหมดอายุ"
  }
}).as("sessionExpired");
// เข้าหน้ารายละเอียดผู้ใช้
cy.visit(`/users/${targetUser.id}`);
// รอการเรียก API
cy.wait("@sessionExpired");
// ตรวจสอบว่าถูกนำทางกลับไปยังหน้าเข้าสู่ระบบ
